import React from 'react';
const MealsList = (props) => {    

    return(
        <>
        <li><h6></h6>{props.mealDetails.name}</li>
        <li>{props.mealDetails.description}</li>
        <li>{props.mealDetails.price}</li>
        </>
    );
};
export default MealsList;
